    methodology: '<p><b>a) Methodology of calculating sale price.</b>The price or NAV, an investor is charged while investing in anopen-ended scheme is called sale or subscription price. Pursuant to SEBI Circular dated June 30, 2009, no entry load will be charged by the scheme to the investors. Therefore, Sale or Subscriptionprice = Applicable NAV (for respective plan and option of the scheme)</p>\n<p>&nbsp;</p>\n<p><b>Example:</b> An investor invests Rs.10,000/- and the current NAV is Rs. 10/- then the purchase price will be Rs.10/- and the investorreceives 10,000/10 = 1000 units.</p>\n<p>&nbsp;</p>\n<p><b>b) Methodology of calculating repurchase price of Units: </b>Repurchase or redemption price is the price or NAV at which an open-ended scheme purchases or redeems its units from the investors. It may include exit load, if applicable. The exit load, if any, shall be charged as a percentage of Net Assets Value (NAV) i.e. applicable load as a percentage of NAV will be deducted from the ÒApplicable NAVÓ to calculate the repurchase price. Therefore, Repurchase or Redemption Price = Applicable NAV*(1- Exit Load, if any)</p>\n<p>&nbsp;</p>\n<p><b>Example:</b> If the Applicable NAV is Rs. 10 and a 2% Exit Load ischarged, the Redemption Price per Unit will be calculated as follows: = Rs. 10 * (1-0.02) = Rs. 10 * (0.98) = Rs. 9.80</p>\n',
