    methodology: '<p><b>a) Methodology of calculating sale price:&nbsp;</b>The price or NAV, an investor is charged while investing in an open-ended scheme is called sale or subscription price. Pursuant to SEBI Circular dated June 30, 2009, no entry load will be charged by the scheme to the investors. Therefore, Sale or Subscription price = Applicable NAV (for respective plan and option of the scheme) Pursuant to SEBI Circular No. SEBI/IMD/DF2/OW/P/2020/11099/1 dated June 29, 2020, Gazette notification dated March 30, 2020 for extending the effective date for applicability of new stamp duty rules and as per Notification No. S.O. 4419(E) dated December 10, 2019 issued by Department of Revenue, Ministry of Finance, Government of India, read with Part I of Chapter IV of Notification dated February 21, 2019 issued by&nbsp;Legislative Department, Ministry of Law and Justice, Government of India on the Finance Act, 2019, a stamp duty @ 0.005% of the transaction value would be levied on all mutual fund inflow transactions i.e. purchases (including Switch-ins), SIP / STP instalments (including IDCW reinvestment) with effect from July 01, 2020. Accordingly, pursuant to levy of stamp duty, the number of units allotted to the unit holders would be lower to that extent. Kindly refer the example below for better understanding.</p>\n<p>&nbsp;</p>\n<p><b>Example:</b> An investor invests Rs. 10,000/- and the current NAV is Rs. 10/- then the purchase price will be Rs.10/-. After deduction of stamp duty investor will receive 999.95 units</p>\n<p>&nbsp;</p>\n<p><b>b) Methodology of calculating repurchase price of Units:&nbsp;</b>Repurchase or redemption price is the price or NAV at which an openended scheme purchases or redeems its units from the investors. It may include exit load, if applicable. The exit load, if any, shall be charged as a percentage of Net Assets Value (NAV) i.e. applicable load as a percentage of NAV will be deducted from the “Applicable NAV” to calculate the repurchase price. Therefore, Repurchase or Redemption Price = Applicable NAV *(1- Exit Load, if any)</p>\n<p>&nbsp;</p>\n<p><b>Example:</b> If the Applicable NAV is Rs. 10 and a 2% Exit Load is charged, the Redemption Price per Unit will be calculated as follows: = Rs. 10 * (1- 0.02) = Rs. 10 * (0.98) = Rs. 9.80</p>\n',
