    methodology: '<p><b>Methodology and illustration of sale and repurchase price of units:</b></p>\n<p><b>a) Methodology of calculating sale price:&nbsp;</b>The price or NAV, an investor is charged while investing in an open-ended scheme is called sale or subscription price. Pursuant to SEBI Circular dated June 30, 2009, no entry load will be charged by the scheme to the investors. Therefore, Sale or Subscription price = Applicable NAV (for respective plan and option of the scheme)</p>\n<p><b>Example:</b> An investor invests Rs.10,000/- and the current NAV is Rs. 10/- then the purchase price will be Rs.10/- and the investor receives 10,000/10 = 1000 units.</p>\n<p>&nbsp;</p>\n<p><b>b)</b>&nbsp;<b>Methodology of calculating repurchase price of Units:&nbsp;</b>Repurchase or redemption price is the price or NAV at which an open-ended scheme purchases or redeems its units from the investors.It may include exit load, if applicable. The exit load, if any, shall be charged as a percentage of Net Assets Value (NAV) i.e. applicable load as a percentage of NAV will be deducted from the “Applicable NAV” to calculate the&nbsp;repurchase price. Therefore, Repurchase or Redemption Price = Applicable NAV*(1- Exit Load, if any)</p>\n<p><b>Example:</b> If the Applicable NAV is Rs. 10 and &nbsp;2% Exit Load is charged, the Redemption Price per Unit will be calculated as follows: =Rs. 10 * (1-0.02) = Rs. 10 * (0.98) = Rs. 9.80.</p>\n',
