    methodology: '<p><b>a) Methodology of calculating sale price</b></p>\n<p>The price or NAV, an investor is charged while investing in an openended&nbsp;scheme is called sale or subscription price. Pursuant to SEBI<br>\nCircular dated June 30, 2009, no entry load will be charged by the scheme&nbsp;to the investors. Therefore, Sale or Subscription price = Applicable NAV&nbsp;(for respective plan and option of the scheme)</p>\n<p><br>\nExample: An investor invests Rs.10,000/- and the current NAV is Rs. 10/-&nbsp;then the purchase price will be Rs.10/-. After deduction of stamp duty&nbsp;investor will receive 999.95 units</p>\n<p>&nbsp;</p>\n<p><b>b) Methodology of calculating repurchase price of Units</b></p>\n<p>Repurchase or redemption price is the price or NAV at which an openended&nbsp;scheme purchases or redeems its units from the investors. It may&nbsp;include exit load, if applicable. The exit load, if any, shall be charged as a&nbsp;percentage of Net Assets Value (NAV) i.e. applicable load as a percentage&nbsp;of NAV will be deducted from the “Applicable NAV” to calculate the&nbsp;repurchase price. Therefore, Repurchase or Redemption Price =&nbsp;Applicable NAV *(1- Exit Load, if any)&nbsp;</p>\n<p>&nbsp;</p>\n<p>Example: If the Applicable NAV is Rs. 10 and a 2% Exit Load is charged, the Redemption Price per Unit will be calculated as follows: = Rs. 10 * (1-&nbsp;0.02) = Rs. 10 * (0.98) = Rs. 9.80&nbsp;</p>\n',
