    methodology: '<p><b>a) Methodology of calculating sale price:</b>&nbsp;The price or NAV, an investor is charged while investing in anopen-ended scheme is called sale or subscription price. Pursuant toSEBI Circular dated June 30, 2009, no entry load will be chargedby the scheme to the investors. Therefore, Sale or Subscriptionprice = Applicable NAV (for respective plan and option of thescheme)</p>\n<p><b>Example:&nbsp;</b>An investor invests Rs.10,000/- and the current NAV isRs. 10/- then the purchase price will be Rs.10/- and the investorreceives 10,000/10 = 1000 units.</p>\n<p><b>b) Methodology of calculating repurchase price of Units:</b>&nbsp;Repurchase or redemption price is the price or NAV at which anopen-ended scheme purchases or redeems its units from theinvestors. It may include exit load, if applicable. The exit load, ifany, shall be charged as a percentage of Net Asasets Value (NAV)i.e. applicable load as a percentage of NAV will be deducted fromthe ÒApplicable NAVÓ to calculate the repurchase price.Therefore, Repurchase or Redemption Price = Applicable NAV*(1- Exit Load, if any)</p>\n<p><b>Example:&nbsp;</b>If the Applicable NAV is Rs. 10 and a 2% Exit Load ischarged, the Redemption Price per Unit will be calculated asfollows: = Rs. 10 * (1-0.02) = Rs. 10 * (0.98) = Rs. 9.80</p>\n',
