    methodology: '<p><b>a) Methodology of calculating sale price: </b>The price or NAV, an investor is charged while investing in anopen-ended scheme is called sale or subscription price. Pursuantto SEBI Circular dated June 30, 2009, no entry load will becharged by the scheme to the investors. Therefore, Sale orSubscription price = Applicable NAV (for respective plan andoption of the scheme)Pursuant to SEBI Circular No.SEBI/IMD/DF2/OW/P/2020/11099/1 dated June 29, 2020,Gazette notification dated March 30, 2020 for extending theeffective date for applicability of new stamp duty rules and as perNotification No. S.O. 4419(E) dated December 10, 2019 issuedby Department of Revenue, Ministry of Finance, Government ofIndia, read with Part I of Chapter IV of Notification datedFebruary 21, 2019 issued by Legislative Department, Ministry ofLaw and Justice, Government of India on the Finance Act, 2019,a stamp duty @ 0.005% of the transaction value would be leviedon all mutual fund inflow transactions i.e. purchases (includingSwitch-ins), SIP / STP installments (including dividendreinvestment) with effect from July 01, 2020. Accordingly,pursuant to levy of stamp duty, the number of units allotted to theunit holders would be lower to that extent. Kindly refer theexample below for better understanding.</p>\n<p><b>Example:</b> An investor invests Rs.10,000/- and the current NAV isRs. 10/- then the purchase price will be Rs.10/-. After deductionof stamp duty investor will receive 999.95 unitsInvestment amount Rs.10,000/- ALess: Transactioncharges (deducted andpaid to distributor, ifapplicable)NIL BStamp duty applicable(@0.005%)0.50 C = (AB)*0.005/100.005Net Investment amount 9,999.50/- D = (A - B - C)NAV Rs.10/- EUnits allotted 999.95 F = D / E</p>\n<p><b>b) Methodology of calculating repurchase price of Units:</b> Repurchase or redemption price is the price or NAV at which anopen-ended scheme purchases or redeems its units from theinvestors. It may include exit load, if applicable. The exit load, ifany, shall be charged as a percentage of Net Assets Value (NAV)i.e. applicable load as a percentage of NAV will be deductedfrom the ÒApplicable NAVÓ to calculate the repurchase price.Therefore, Repurchase or Redemption Price = Applicable NAV*(1- Exit Load, if any)</p>\n<p><b>Example: </b>If the Applicable NAV is Rs. 10 and a 2% Exit Load is charged, the Redemption Price per Unit will be calculated asfollows: = Rs. 10 * (1-0.02) = Rs. 10 * (0.98) = Rs. 9.80</p>\n',
